import React from 'react';
import Title from '../title/Title';

const InfoItem = ({ infoTitle, infoValue }) => (
    <li className="mb-2">
        <div className="row">
            <div className="col-4 font-weight-bold">{infoTitle}</div>
            <div className="col-8">{infoValue}</div>
        </div>
    </li>
);

class InfoList extends React.Component{

    state = {
        allInfo: [
            {
                infoTitle: 'Age',
                infoValue: 23,
            },
            {
                infoTitle: 'Languages',
                infoValue: 'English, Germany',
            },
            {
                infoTitle: 'Nationality',
                infoValue: 'American',
            },
            {
                infoTitle: 'Address',
                infoValue: 'mohanpur, Nadia West Bengal',
            },
            {
                infoTitle: 'Freelance',
                infoValue: 'till December 25, 2020',
            },
        ]
    }

    render(){
        return(
            <>
                <Title>About</Title>
                <ul className="list-unstyled p-3">
                    {
                        this.state.allInfo.map((item, index) => (
                            <InfoItem key={index} {...item} />
                        ))
                    }
                </ul>
            </>
        );
    }
}

export default InfoList;
